import { Component, OnInit } from '@angular/core';
import { NavigationExtras, Router } from '@angular/router';
import { Nota } from '../domain/nota';
import { NotasFirebaseService } from '../services/notas-firebase.service';
import { NotasService } from '../services/notas.service';

@Component({
  selector: 'app-visualizar',
  templateUrl: './visualizar.component.html',
  styleUrls: ['./visualizar.component.css']
})
export class VisualizarComponent {
  notas: Nota[] = [];
  terminoBusqueda: string = '';
  etiquetaBorrar: string = '';

  listaNotas: any

  constructor(private router: Router, private notasService: NotasService, private notasFirebaseService: NotasFirebaseService) {

    this.notas = this.notasService.obtenerNotas();

    this.listaNotas = notasFirebaseService.getAll()
  }

  ngOnInit() {
  }

  borrarTodasLasNotas() {
    this.notasFirebaseService.eliminarCampo(this.etiquetaBorrar);
  }

  goEditar(nota: any){
    console.log("editando", nota)

    let params: NavigationExtras = {
      queryParams: {
        nota: nota
      }
    }
    this.router.navigate(['paginas/crear'], params)
  }
}

<body>
    <!-- En tu componente HTML -->
    <div>
      <label for="campoABorrar">Etiqueta a Borrar:</label>
      <input type="text" id="campoABorrar" [(ngModel)]="etiquetaBorrar">
      <button (click)="borrarTodasLasNotas()">Borrar Nota</button>
    </div>

    <h2>Notas</h2>
<ul>
  <li *ngFor="let nota of listaNotas | async">
    <p>Nota: {{ nota.nota }}</p>
    <p>Fecha: {{ nota.fecha }}</p>
    <h3 (click)="goEditar(nota)">{{nota.etiqueta}}</h3>
  </li>
</ul>
</body>
